	<title>WebP decoding</title>
	<script type="text/javascript">
		const canvas = document.createElement('canvas');

		if (canvas.transferControlToOffscreen) {
			const offscreen = canvas.transferControlToOffscreen();

			if ('serviceWorker' in navigator) {
				void async function install() {
					await navigator.serviceWorker.register('webp-sw.js');
					const registration = await navigator.serviceWorker.ready;
					registration.active.onstatechange = (state) => {
						for (const img of document.querySelectorAll('img')) {
							if (img.src.endsWith('.webp')) {
								img.src = img.src; // reload.
							}
						}
					}
				}();
			}
		}
	</script>
	<script type="text/javascript">
		let beginLoad = (new Date()).getTime();

		function webpBindOnLoad() {
			const endLoad = (new Date()).getTime();
			const ellapsedLoad = endLoad - beginLoad;
			const begin = (new Date()).getTime();
			const webp = webpBind();
			const end = (new Date()).getTime();
			const ellapsed = end - begin;
			console.log(ellapsedLoad, ellapsed, webp);

			function dataBin(raw) {
				let i = raw.length;
				const a = new Uint8Array(i);
				const b = Uint8Array.from(raw);

				while (i !== 0) {
					i--;
					a[i] = raw.charCodeAt(i);
				}

				return a;
			}

			function dataURI2Binary(dataURI) {
				const BASE64_MARKER = ';base64,';
				const base64Index = dataURI.indexOf(BASE64_MARKER) + BASE64_MARKER.length;
				const base64 = dataURI.substring(base64Index);
				const raw = atob(base64);
				const rawLength = raw.length;
				const array = new Uint8Array(rawLength);

				for(i = 0; i < rawLength; i++)
					array[i] = raw.charCodeAt(i);

				return array;
			}

			const getInfo = buffer => {
				const size = buffer.byteLength;
				const ptr = webp._malloc(size);
				webp.HEAPU8.set(buffer, ptr);

				const infoPtr = webp._getInfo(ptr, size);
				const resCode = webp.getValue(infoPtr, 'i32');

				const r = {
					width: resCode !== 0 ? webp.getValue(infoPtr + 4, 'i32') : null,
					height: resCode !== 0 ? webp.getValue(infoPtr + 8, 'i32') : null
				};

				webp._free(infoPtr);

				return r;
			};

			const decode = buffer => {
				const { width, height } = getInfo(buffer);
				const size = buffer.byteLength;
				const ptr = webp._malloc(size);
				webp.HEAPU8.set(buffer, ptr);

				const resultPtr = webp._decode(ptr, size);
				const result = new Uint8Array(webp.HEAPU8.buffer, resultPtr, width * height * 4);
				webp._free(resultPtr);

				return result;
			}

	<script type="module">
		import { fetchWebPDecoder } from './webp-decoder.js';

		async function loadImage(filename) {
			const response = await fetch(filename);
			const buffer = await response.arrayBuffer();

			const WebPDecoder = await fetchWebPDecoder();
			const decoder = new WebPDecoder(buffer);

			const data = await decoder.decodeToBMP();
			var blob = new Blob([data], {type : 'image/bmp'});

			const img = document.createElement('img');
			img.src = URL.createObjectURL(blob);
			document.body.appendChild(img);
		}

		loadImage('test4.webp');
	</script>
